import React from "react";
import { Header, VStack, HStack, Box } from "@chakra-ui/react";

import Sidebar from "./Sidebar";

function Dashboard({}) {
  return (
    <>
      <HStack>
        <Sidebar />
        <Box bg="white" w="20vw"></Box>
        <Box bg="gray.100" flexGrow="1" height="110vh">
          {/* <DashContent /> */}
        </Box>
      </HStack>
    </>
  );
}

function DashContent({}) {
  return (
    <VStack>
      <Header fontWeight="light" size="xl">
        Dashboard
      </Header>
    </VStack>
  );
}

export default Dashboard;
